import React from "react";
import {AutoSizer, Column, ColumnProps} from 'react-virtualized'
import HeaderCell from "./HeaderCell";


interface IProps extends ColumnProps{
    key: string
    dataKey: string
    headerValue: string
    cellRenderer: (cellData: any, columnData: any, dataKey: string, rowData: any, index: number) => JSX.Element
}

const TableColunm: React.FC<IProps> = (props) =>{

    const {key, dataKey, width, headerValue, style, cellRenderer} = props

    return(
      
            <Column
                key={key}
                style={style}
                dataKey={dataKey} 
                width={width}
                cellRenderer={(cell) => cellRenderer(cell.cellData, cell.columnData, cell.dataKey, cell.rowData, cell.rowIndex)}
                headerRenderer={() => (<HeaderCell value = {headerValue}/>)}
            />
    )
} 

export default TableColunm
